select * from (select * from (select l_orderkey, sum(l_extendedprice*(1-l_discount)) as revenue, o_orderdate, o_shippriority
from (select * from lineitem where ((l_orderkey >= 3354465) AND (l_orderkey < 3360226)) OR ((l_orderkey >= 4785860) AND (l_orderkey < 4792162)) OR ((l_orderkey >= 9805574) AND (l_orderkey < 9811456)) OR ((l_orderkey >= 16383556) AND (l_orderkey < 16389381)) OR ((l_orderkey >= 22806022) AND (l_orderkey < 22812065)) OR ((l_orderkey >= 23858176) AND (l_orderkey < 23864132)) OR ((l_orderkey >= 23905927) AND (l_orderkey < 23911936)) OR ((l_orderkey >= 46677121) AND (l_orderkey < 46683106)) OR ((l_orderkey >= 52968675) AND (l_orderkey < 52974213)) OR ((l_orderkey >= 59391906) AND (l_orderkey < 59397990)) ) ll,
(select * from orders where ((o_orderkey >= 3354593) AND (o_orderkey < 3360387)) OR ((o_orderkey >= 4789063) AND (o_orderkey < 4795140)) OR ((o_orderkey >= 9803431) AND (o_orderkey < 9809830)) OR ((o_orderkey >= 16379970) AND (o_orderkey < 16386180)) OR ((o_orderkey >= 22807875) AND (o_orderkey < 22813506)) OR ((o_orderkey >= 23858083) AND (o_orderkey < 23863622)) OR ((o_orderkey >= 23906562) AND (o_orderkey < 23912611)) OR ((o_orderkey >= 46677444) AND (o_orderkey < 46683681)) OR ((o_orderkey >= 52970439) AND (o_orderkey < 52976103)) OR ((o_orderkey >= 59391872) AND (o_orderkey < 59397923))) oo,
(select * from customer where ((c_custkey >= 173400) AND (c_custkey < 173550)) OR ((c_custkey >= 304200) AND (c_custkey < 304350)) OR ((c_custkey >= 447150) AND (c_custkey < 447300)) OR ((c_custkey >= 516450) AND (c_custkey < 516600)) OR ((c_custkey >= 634200) AND (c_custkey < 634350)) OR ((c_custkey >= 654150) AND (c_custkey < 654300)) OR ((c_custkey >= 713250) AND (c_custkey < 713400)) OR ((c_custkey >= 768600) AND (c_custkey < 768750)) OR ((c_custkey >= 830700) AND (c_custkey < 830850)) OR ((c_custkey >= 1322250) AND (c_custkey < 1322400)) ) cc
where c_mktsegment = 'BUILDING' and c_custkey = o_custkey and l_orderkey = o_orderkey and o_orderdate < '1995-03-15' and l_shipdate > '1995-03-15' group by l_orderkey, o_orderdate, o_shippriority) l2 order by revenue desc, o_orderdate) l1 limit 10;
